import React from 'react';
import { Link } from 'react-router-dom';

import './Welcome.css';

const Welcome = () => {


    return (
        <React.Fragment>
        <div className="Welcome">
            <form>
                <input placeholder="Email"/>                
            </form>
            <form>
                <input placeholder="Password"/>
            </form>
            <button>Sign In</button>
            <button2>
                <Link to="/Register">Register</Link>
            </button2>
        </div>
        </React.Fragment>
    )
}

export default Welcome;
